import Header from "./Components/Layout/Header";
import { Switch, Route, Redirect } from "react-router-dom";
function App() {
  return (
    <div>
      <Header>
        <Route path="/" exact>
          <Redirect to="/home" />
        </Route>
        <Route path="/home">
          <Home />
        </Route>
        <Route path="/about">
          <About />
        </Route>
        <Route path="/shop">
          <Shop />
        </Route>
        <Route path="/help">
          <Help />
        </Route>
      </Header>
    </div>
  );
}

export default App;
